import React, { Component } from 'react';
import './App.css';
import data from './data.json'

class App extends Component{
  render(){
    console.log("data",data);


    return(
      <div>
       <div id="header">
         <h3 id ="appTitle">Widget Depot</h3>
         <i style={{fontSize:"24px",float:"right"}} class='fas'>&#xf2bd;</i>
        </div>

      </div>
    )
  }
}
export default App;
